 var email=Cookies.get("email");
    var pass=Cookies.get("password");
var market=$("#market").val();
function doMyOrder(){
    $.ajax
            ({
                type:'post',
                url:orderbook_servers[0]+'/api/public/orderdata/userOrder.php',
                data:{
                    email:email,
                    password:pass,
                    pair:market
                },
        complete:function(jx,ror){
            
            var usrobj = JSON.parse(jx.responseText);
            console.log(usrobj);
            var tab='';
            for(var i=0;i<usrobj.length;i++){
                
                  tab  =tab.concat('<tr><td>'+usrobj[i].time+'</td><td>'+usrobj[i].price+'</td><td>'+usrobj[i].size);
                
            }
                $('#order-table').html(tab);
            
            
                        }
        
            });
}
if($('#index-heading').text()=="Trade" && loginstatus==gii){
  doMyOrder();
    
}

 var email=Cookies.get("email");
    var pass=Cookies.get("password");
var market=$("#market").val();
var pair=market.substring(0,3)+'/'+market.substring(3,6);


$("#submit-buy").click(function doLogin() {
    
        
        var price=$("#price").val();
        var amount=$("#amount").val();
        
        if(email!="" && pass!="" && price!='' && amount!='')
        {
            $.ajax
            ({
                type:'post',
                url:orderbook_servers[0]+'/api/public/trading/shootLimitOrder.php',
                data:{
                    email:email,
                    password:pass,
                    pair:pair,
                    price:price,
                    size:amount
                },
                success:function(response) {
                    $('#alert-trading').html('<div role="alert" class="alert alert-secondary"><span>'+response+'</span></div>');
                    doMyOrder();
                },
      error: function (xhr, ajaxOptions, thrownError) {
        alert(xhr.status);
        alert(thrownError);
      }
    
            });
        }
});
$("#submit-sell").click(function doBuy() {
    
        var market=$("#market").val();
        var price=$("#price2").val();
        var amount=$("#amount2").val()*-1;
        
        if(email!="" && pass!="" && price!='' && amount!='')
        {
            $.ajax
            ({
                type:'post',
                url:orderbook_servers[0]+'/api/public/trading/shootLimitOrder.php',
                data:{
                    email:email,
                    password:pass,
                    pair:pair,
                    price:price,
                    size:amount
                },
                success:function(response) {
                    $('#alert-trading').html('<div role="alert" class="alert alert-secondary"><span>'+response+'</span></div>');
                    doMyOrder();
                },
      error: function (xhr, ajaxOptions, thrownError) {
        alert(xhr.status);
        alert(thrownError);
      }
            });
        }
});
function getBidAsk(){
    $.ajax
            ({
                type:'post',
                url:orderbook_servers[0]+'/api/public/orderdata/latestBidandAsk.php',
                data:{
                    pair:market
                },
                complete:function(jx,error){
                    console.log(jx.responseText);
                    var bidask = JSON.parse(jx.responseText);
                     console.log(bidask);
                    $('#bid').text(bidask.bidprice);
                    $('#ask').text(bidask.askprice);
                    $('#spread').text(bidask.askprice-bidask.bidprice);
                    getBidAsk();
                }
            });
}

if($('#index-heading').text()=="Trade"){
    getBidAsk();
       
}
